import React from 'react';


const Rank = ({ name, entries }) => {
	return(
		 <div> 
		 	<div className='white f3'>
		 		{`${entries} ,your current entry count is .....`}
		 	</div>
		 	<div className='white f1'>
		 		{name}
		 	</div>
		 </div>
	);
}

export default Rank;
